import React from "react";
import Card from "./Card";
class CarList extends React.Component {

    render() {

        const cars = this.props.cars.map(
            car => {
                <Card key={car.id} 
                make={car.make}
                model={car.model}
                year={car.year}
                color={car.color}
                price={car.price}/>

            }
        )
        return (
            <div>
                {cars}
            </div>
        )
    }

}

export default CarList;
